const Regions = ({ regions, selectRegion }) => {
  return (
    <div class="col s12 m6 l3">
      <h2 class="center-align">Regions</h2>
      <div class="collection">
        {regions.map((region) => (
          <a href="#" className="collection-item" key={region} onClick={() => selectRegion(region)}>
          {region}
          </a>
        ))}
      </div>
    </div>
  )
}

export default Regions
